import "./App.css";
import React from "react";
import data from "./data";
import "../../../node_modules/bootstrap/dist/css/bootstrap.css";
import Profile from "../profile/Profile";
import {
  Container,
  Row,
  Col,
  Button,
  Alert,
  Breadcrumb,
  Card,
  Form,
} from "react-bootstrap";



function handleName(fullName) {
  alert(fullName);
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Container>
          <h1>Profile</h1>
          {data.map((profile) => (
            <Profile
              fullName={profile.fullName}
              bio={profile.bio}
              profession={profile.profession}
              handleName={handleName}
            />
          ))}
          <Form>
            <Row>
              <Col md>
                <Form.Group controlId="formEmail">
                  <Form.Label>Email Address</Form.Label>
                  <Form.Control type="email" placeholder="Example@email.com" />
                  <Form.Text className="text-muted">
                    We'll never share you email Address, trust us!
                  </Form.Text>
                </Form.Group>
              </Col>
              <Col md>
                <Form.Group controlId="formPassword">
                  <Form.Label>Password</Form.Label>
                  <Form.Control type="password" placeholder="Password" />
                </Form.Group>
              </Col>
            </Row>
            <Button variant="warning" type="submit">
              Login
            </Button>
          </Form>
          <Card className="mb-3 mt-3" style={{ color: "#000" }}>
            <Card.Img src="https://image.shutterstock.com/image-photo/happy-african-family-having-fun-600w-1897808689.jpg" />
            <Card.Body>
              <Card.Title>Card example</Card.Title>
              <Card.Text>This is an example of bootstrap react cards</Card.Text>
              <Button variant="primary">Read More</Button>
            </Card.Body>
          </Card>
          <Breadcrumb>
            <Breadcrumb.Item>Test</Breadcrumb.Item>
            <Breadcrumb.Item>Test1</Breadcrumb.Item>
            <Breadcrumb.Item active>Test2</Breadcrumb.Item>
          </Breadcrumb>
          <Alert variant="secondary">This is a Button</Alert>
          <Button>Press</Button>
        </Container>
      </header>
    </div>
  );
}

export default App;
